import React from "react";

const Header = () => {
  return (
    <>
      <div>
        <img
          src="https://seeklogo.com/images/G/google-keep-logo-0BC92EBBBD-seeklogo.com.png"
          alt="logo"
          width="50"
          className="header1"
          height="50"
        />
        <h1>Keep</h1>
      </div>
    </>
  );
};

export default Header;
